import {extedObservable, extendObservable} from 'mobx';

/**
 * UserStore
 */

 class UserStore{
    constructor(){
        extendObservable(this,{
            loading:false,
            isLoggedIn: false,
            userName: ''
        })
    }   
 }

 export default new UserStore();
